import Wait from './Wait';
import Button from '../Button';

const AwaitQuestion = () => {
  return (
    <Wait title="Antwoord succesvol ingediend. De Quizmaster is de antwoorden aan het controleren...">
      <Button>Vraag aanpassen</Button>
    </Wait>
  );
};

export default AwaitQuestion;
